class WebApp{isAndroid(){return window.navigator.userAgent.toLowerCase().includes("android")}showToast(i){this.isAndroid()&&Android.showToast(i)}downloadFile(i,d){this.isAndroid()&&Android.download(i,d)}openFilePicker(){this.isAndroid()&&Android.openFilePicker()}setUploadPath(i){this.isAndroid()&&setUploadPath(i)}uploadFile(i,d,e,t){this.isAndroid()&&Android.uploadFile(i,d,e,t)}setBaseUrl(i){this.isAndroid()&&Android.setBaseUrl(i)}exitApp(){this.isAndroid()&&Android.exitApp()}openExternalApp(i,d,e){this.isAndroid()&&Android.openExternalApp(i,d,e)}isPresentExternalApp(i){return Android.isPresentExternalApp(i)}getDeviceId(){return this.isAndroid()?Android.getDeviceId():void 0}initQRScanner(){this.isAndroid()&&Android.initQRScanner()}}function uploadFileDone(n,i){window.dispatchEvent(new CustomEvent("uploadFileDone",{detail:{name:n,absolutePath:i}}))}function setUploadPath(n){window.dispatchEvent(new CustomEvent("setUploadPath",{detail:{absolutePath:n}}))}function qrScanResult(n){window.dispatchEvent(new CustomEvent("qrScanResult",{detail:{result:n}}))}